  true,\n\t\"url\": null,\n\t\"notes\": \"<p>CLIA requires all laboratories that examine
  materials derived from the human body for diagnosis, prevention, or treatment purposes
  to be certified by the Secretary of Health and Human Services. For many Americans,
  the accuracy of clinical laboratory test results can be a life or death matter.
  By the CLIA law, certificate of waiver (COW) laboratories perform only tests that
  are determined by FDA or CDC to be so simple that there is little risk of error.</p>n\",\n\t\"license_title\":
